<script type="text/template" class="J_PMListTemplate">
        <ul>
            {{#each paiItems}}
            {{#if showCustomBanner}}
            <li class="pai-item banner">
                {{#if link}}<a href="{{link}}" target="_blank">{{/if}}
                    <img src="{{img}}" alt="{{title}}"/>
                {{#if link}}</a>{{/if}}
            </li>
            {{else}}
            <li class="pai-item pai-status-{{status}} pai-nth{{xindex%2}} pai-position{{xindex%4}}" id="pai-item-{{id}}">
                <a href="{{itemUrl}}" target="_blank" class="link-wrap">
                    <div class="img-section">
                        <img data-ks-lazyload="{{#if subPic}}{{subPic}}{{else}}{{picUrl}}_320x320q75{{/if}}" src="//g.alicdn.com/s.gif" alt="{{{title}}}"/>
                    </div>
                    <div class="info-section">
                        <p class="title" title="{{{title}}}">{{{title}}}</p>
                        {{#if subTitle}}<p class="sub-title" title="{{{subTitle}}}">{{{subTitle}}}</p>{{/if}}
                        <div class="sep{{#if consultPrice}} sep-short{{/if}}"></div>

                        {{#if customAddress}}
                        <p class="address">
                            <span class="label">所在地：</span>
                            <span class="value"><em>{{customAddress}}</em></span>
                        </p>
                        {{/if}}
                        <!-- price { -->
                        <p class="price price-todo pai-status-todo-show">
                            <span class="label">起拍价：</span>
                            <span class="value"><em class="currency">&yen;</em><em>{{{setPrice initialPrice}}}</em></span>
                        </p>

                        <p class="price price-doing pai-status-doing-show">
                            <span class="label">当前价：</span>
                            <span class="value"><em class="currency">&yen;</em><em class="pai-xmpp-current-price">{{{setPrice currentPrice}}}</em></span>
                        </p>

                        <p class="price price-done pai-status-break-show
                                                    pai-status-revocation-show
                                                    pai-status-cancel-show">
                            <span class="label">当前价：</span>
                            <span class="value"><em class="currency">&yen;</em><em class="pai-xmpp-current-price">{{{setPrice currentPrice}}}</em></span>
                        </p>

                        <p class="price price-done pai-status-done-show
                                                   pai-status-success-show">
                            <span class="label">成交价：</span>
                            <span class="value"><em class="currency">&yen;</em><em class="pai-xmpp-current-price">{{{setPrice currentPrice}}}</em></span>
                        </p>
                        {{#if consultPrice}}
                        <p class="price price-assess">
                            <span class="label">评估价：</span>
                            <span class="value"><em class="currency">&yen;</em><em>{{{setPrice consultPrice}}}</em></span>
                        </p>
                        {{/if}}
                        <!-- } price -->

                        <!-- time / countdown { -->
                        <p class="time time-todo pai-status-todo-show">
                            {{format start}} 开拍
                        </p>

                        <p class="time time-doing pai-status-doing-show">
                            <span class="label">距结束：</span>
                            <span class="value pai-countdown pai-xmpp-countdown" data-itemId="{{id}}" data-timeToEnd="{{timeToEnd}}"
                                  data-timeToStart="{{timeToStart}}" data-end="{{end}}" data-start="{{start}}">
                                <span class="J_TimeLeft">...</span>
                            </span>
                        </p>

                        <p class="time time-done pai-status-done-show
                                            pai-status-break-show
                                            pai-status-revocation-show
                                            pai-status-success-show
                                            pai-status-cancel-show">
                            <span class="label">结束时间：</span>
                            <span class="value">{{format end}}</span>
                        </p>

                        <!-- } time / countdown -->
                        <!-- bid / status { -->
                        <div class="bid-status-section">
                            <!-- bid { -->
                            <p class="bid bid-todo pai-status-todo-show">
                                <span class="value pai-xmpp-viewer-count">{{itemPV}}</span>
                                <span class="label">次围观</span>
                            </p>

                            <p class="bid bid-doing pai-status-doing-show">
                                <span class="value pai-xmpp-bid-count">{{bidCount}}</span>
                                <span class="label">次出价</span>
                            </p>

                            <p class="bid bid-done pai-status-done-show
                                                   pai-status-break-show
                                                   pai-status-revocation-show
                                                   pai-status-success-show
                                                   pai-status-cancel-show">
                                <span class="value pai-xmpp-bid-count">{{bidCount}}</span>
                                <span class="label">次出价</span>
                            </p>
                            <!-- } bid -->

                            <div class="flag flag-todo pai-status-todo-show">
                                <span class="pai-iconfont pai-iconfont-apply">保</span>立即报名<span class="pai-iconfont pai-iconfont-arrow">></span>
                            </div>
                            <div class="flag flag-doing pai-status-doing-show">
                                <span class="pai-iconfont pai-iconfont-bid">锤</span>立即出价<span class="pai-iconfont pai-iconfont-arrow">></span>
                            </div>
                            <div class="flag flag-done pai-status-done-show">已结束</div>
                            <div class="flag flag-done pai-status-break-show">已结束</div>
                            <div class="flag flag-done pai-status-revocation-show">已结束</div>
                            <div class="flag flag-done pai-status-success-show">已结束</div>
                            <div class="flag flag-done pai-status-cancel-show">已结束</div>
                        </div>
                        <!-- } bid / status  -->
                    </div>
                    {{#if mainTitle}}<span class="icon-max">{{mainTitle}}</span>{{/if}}
                </a>
            </li>
            {{/if}}
            {{/each}}
        </ul>
    </script>
<div class="J_PMListContainer pai-list-wrap pai-list-container loading">
